import SidebarElements from './SidebarElements';
import { BrowserRouter, NavLink, Route } from 'react-router-dom';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';


export const Sidebar = () => {
    const [sidebarStatus, setSidebarStatus] = useState(false);
    return (
        <>  <button className="sideButton" onClick={() => setSidebarStatus(!sidebarStatus)}>
            TEST
            </button>
            <SidebarElements setSidebarStatus={setSidebarStatus} sidebarStatus={sidebarStatus} width={200} >
                <div className="sideLogo"><NavLink to="/" className="test"><span className="paseSide">TUPASE</span><span className="carnavalSide">DECARNAVAL</span></NavLink></div>
                <div className="sideText">
                    <NavLink to="/news" className="test">Noticias</NavLink>
                    <NavLink to="/creator" className="test">Creador</NavLink>
                    <NavLink to="/user" className="test">Usuario</NavLink>
                    <NavLink to="/player" className="test">Reproductor</NavLink>
                </div>
            </SidebarElements>

        </>
    );
}



